INSERT INTO `translate` VALUES (23680, 10339, '10004', '指主治及以下医师提供的普通门诊诊疗服务。挂号，初建病历（电子或纸质病历），核实就诊者信息，就诊病历传送，病案管理。询问病情，听取主诉，病史采集，向患者或家属告知，进行一般物理检查，书写病历，开具检查单，根据病情提供治疗方案（治疗单、处方）等。由患者需要提供病历本的，按进价销售。', 'Refers to the general outpatient service provided by the attending physician and the following physicians. Registered, initial medical records (electronic or paper medical records), verify patient information, medical records, medical records management.', NULL, '2019-09-20 16:44:40', NULL, NULL, 'Ask about the condition, listen to the main complaint, collect the medical history, inform the patient or family, conduct general physical examination, write medical records, issue checklists, and provide treatment plans (treatment lists, prescriptions) a', 'description', 'ccording to the condition. If the patient needs to provide medical records, they will be sold at the purchase price.', NULL);
