INSERT INTO `translate` VALUES (23698, 10342, '10004', '指由知名专家在专家门诊提供技术劳务的诊疗服务。挂号，初建病历（电子或纸质病历），核实就诊者信息，就诊病历传送，病案管理。询问病情，听取患者主诉，病史采集，向患者或家属告知，进行一般物理检查，书写病历，开具检查单，根据病情提供治疗方案（治疗单、处方）等病情诊治和健康指导。', 'Refers to the diagnosis and treatment services provided by well-known experts in the technical services of specialist clinics. Registered, initial medical records (electronic or paper medical records), verify patient information, medical records, medical', NULL, '2019-09-20 16:44:57', NULL, NULL, 'records management. Ask the patient, listen to the patient\'s complaint, collect the medical history, inform the patient or family, conduct general physical examination, write medical records, issue checklists, provide treatment plans (treatment lists, pre', 'description', 'scriptions), etc. according to the condition.', NULL);
