INSERT INTO `translate` VALUES (23708, 10344, '10004', 'jzzcf', 'jzzcf', NULL, '2019-09-20 16:45:06', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (23709, 10344, '10004', '次', 'Times', NULL, '2019-09-20 16:45:06', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (23710, 10344, '10004', '指各级急诊医师在护士配合下于急诊区域24小时提供的急诊诊疗服务。挂号，初建病历（电子或纸质病历），核实就诊者信息，就诊病历传送，病案管理。急诊医师询问病情，听取主诉，病史采集，向患者或家属告知，进行一般物理检查，书写病历，开具检查单，提供治疗方案（治疗单、处方）等服务，记录病人生命体征。必要时开通绿色通道。', 'Refers to emergency medical services provided by emergency doctors at all levels in the emergency area 24 hours a day with the cooperation of nurses. Registered, initial medical records (electronic or paper medical records), verify patient information, me', NULL, '2019-09-20 16:45:07', NULL, NULL, 'dical records, medical records management. The emergency doctor asks about the condition, listens to the main complaint, collects the medical history, informs the patient or family, conducts general physical examination, writes a medical record, issues a', 'description', 'checklist, provides a treatment plan (treatment list, prescription), and other services, and records the patient\'s vital signs. Open the green channel if necessary.', NULL);
INSERT INTO `translate` VALUES (23711, 10345, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:45:08', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
