INSERT INTO `translate` VALUES (23713, 10345, '10004', '门或急诊留观诊察费', 'Door or emergency room observation fee', NULL, '2019-09-20 16:45:11', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (23714, 10345, '10004', 'mhjzlgzcf', 'mhjzlgzcf', NULL, '2019-09-20 16:45:12', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (23715, 10345, '10004', '日', 'day', NULL, '2019-09-20 16:45:12', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (23716, 10345, '10004', '挂号，初建病历（电子或纸质病历），核实就诊者信息，就诊病历传送，病案管理。在门/急诊留观室内，医护人员根据病情需求随时巡视患者，观察患者病情及生命体征变化，病史采集，向患者或家属告知，准确记录并提出相应的治疗方案，及时与患者家属交待病情。必要时进行抢救工作。', 'Registered, initial medical records (electronic or paper medical records), verify patient information, medical records, medical records management. In the door/emergency clinic, the medical staff can inspect the patient at any time according to the condit', NULL, '2019-09-20 16:45:13', NULL, NULL, 'ion of the patient, observe the patient\'s condition and vital signs changes, collect the medical history, inform the patient or family, accurately record and propose the corresponding treatment plan, and timely report the condition to the patient\'s family', 'description', '. Rescue work if necessary.', NULL);
INSERT INTO `translate` VALUES (23717, 10346, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:45:14', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (23718, 10346, '10004', '10346', '10346', NULL, '2019-09-20 16:45:16', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (23719, 10346, '10004', '住院诊察费', 'Hospitalization fee', NULL, '2019-09-20 16:45:16', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (23720, 10346, '10004', 'zyzcf', 'zyzcf', NULL, '2019-09-20 16:45:17', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (23721, 10346, '10004', '日', 'day', NULL, '2019-09-20 16:45:18', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (23722, 10346, '10004', '指医务人员对住院患者进行的日常诊察工作。检查及观察患者病情，病案讨论，制定和调整治疗方案，住院日志书写，向患者或家属告知病情，解答患者咨询，院、科级大查房。不含邀请院际或院内会诊进行治疗指导。', 'Refers to the daily medical examination of inpatients by medical staff. Check and observe the patient\'s condition, discuss the medical record, formulate and adjust the treatment plan, write the hospitalization log, inform the patient or family member of t', NULL, '2019-09-20 16:45:19', NULL, NULL, 'he condition, answer the patient consultation, and the hospital and department-level large rounds. There is no invitation for in-hospital or in-hospital consultations for treatment guidance.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (23723, 10347, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:45:20', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
