INSERT INTO `translate` VALUES (23732, 10348, '10004', '指由主治及以下中医或中西医结合医师在中医普通门诊提供的诊疗服务。通过望闻问切收集中医四诊信息，依据中医理论进行辨证，分析病因、病位、病性及病机转化，作出证候诊断，提出治疗方案。含挂号费。', 'Refers to the diagnosis and treatment services provided by the attending physician and the following Chinese medicine practitioners or Chinese and Western medicine practitioners in the general outpatient clinic of Chinese medicine. Through the investigati', NULL, '2019-09-20 16:45:27', NULL, NULL, 'on and collection of information on the four diagnostics of traditional Chinese medicine, according to the theory of traditional Chinese medicine for dialectical analysis, analysis of the cause, disease, disease and pathogenesis, to make a syndrome diagno', 'description', 'sis, and propose a treatment plan. With registration fee.', NULL);
