INSERT INTO `translate` VALUES (23744, 10350, '10004', '指由具有正高级职称的中医或中西医结合医师在中医专家门诊提供的诊疗服务。通过望闻问切收集中医四诊信息，依据中医理论进行辨证，分析病因、病位、病性及病机转化，作出证候诊断，提出治疗方案。含挂号费。', 'Refers to the diagnosis and treatment services provided by traditional Chinese medicine practitioners or Chinese and Western medicine doctors with positive professional titles in the outpatient clinic of traditional Chinese medicine. Through the investiga', NULL, '2019-09-20 16:45:38', NULL, NULL, 'tion and collection of information on the four diagnostics of traditional Chinese medicine, according to the theory of traditional Chinese medicine for dialectical analysis, analysis of the cause, disease, disease and pathogenesis, to make a syndrome diag', 'description', 'nosis, and propose a treatment plan. With registration fee.', NULL);
