INSERT INTO `translate` VALUES (23969, 10393, '10004', '指临床各专业会诊。开通网络计算机系统，通过远程视频系统提供医学资料，对患者的病情进行研讨的多学科、多专家的会诊诊治。', 'Refers to clinical professional consultation. Open a network computer system, provide medical materials through a remote video system, and conduct multidisciplinary and multi-disciplinary consultations on the patient\'s condition.', NULL, '2019-09-20 16:49:09', NULL, NULL, NULL, 'description', NULL, NULL);
INSERT INTO `translate` VALUES (23970, 10394, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:49:10', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
