INSERT INTO `translate` VALUES (23972, 10394, '10004', '远程中医辨证论治会诊', 'Remote TCM Syndrome Differentiation and Treatment Consultation', NULL, '2019-09-20 16:49:12', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (23973, 10394, '10004', 'yczybzlzhz', 'yczybzlzhz', NULL, '2019-09-20 16:49:13', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (23974, 10394, '10004', '小时', 'hour', NULL, '2019-09-20 16:49:14', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (23975, 10394, '10004', '开通网络计算机系统，通过计算机系统提供医学资料，由中医、中西医结合专家对患者的病情进行研讨的会诊诊治，综合中医四诊信息，依据中医理论进行辨证，分析病因、病位、病性及病机转化，作出证候诊断，提出治疗方案。', 'Open a network computer system, provide medical information through a computer system, and discuss the diagnosis and treatment of the patient\'s condition by a combination of Chinese medicine and Chinese and Western medicine experts, comprehensively diagno', NULL, '2019-09-20 16:49:14', NULL, NULL, 'se the four diagnoses of Chinese medicine, and dialectify according to the theory of Chinese medicine to analyze the etiology, disease, disease and The pathogenesis is transformed, a syndrome diagnosis is made, and a treatment plan is proposed.', 'description', NULL, NULL);
