INSERT INTO `translate` VALUES (23989, 10397, '10004', '指生活完全自理、病情稳定的患者、处于康复期患者的护理。每3小时巡视患者，观察患者病情变化，根据患者病情测量患者生命体征，根据医嘱，正确实施治疗，用药，指导患者完成生理需求及康复。完成健康教育及心理护理，书写护理记录。含术前备皮。', 'Refers to patients who are completely self-care, stable in condition, and care for patients in rehabilitation. Every 3 hours, the patient is inspected, the patient\'s condition is observed, and the patient\'s vital signs are measured according to the patien', NULL, '2019-09-20 16:49:27', NULL, NULL, 't\'s condition. According to the doctor\'s advice, the treatment is correctly implemented, and the medicine is used to guide the patient to complete the physiological needs and rehabilitation. Complete health education and psychological care, and write care', 'description', ' records. Contains preoperative skin preparation.', NULL);
INSERT INTO `translate` VALUES (23990, 10398, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:49:28', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
