INSERT INTO `translate` VALUES (23995, 10398, '10004', '指病情稳定、生活部分自理的患者或行动不便的老年患者的护理。每2-3小时巡视患者，观察患者病情变化，根据患者病情测量患者体温、脉搏、呼吸等生命体征，根据医嘱正确实施治疗，用药，根据患者身体状况，实施护理措施和安全措施，对患者提供适宜的照顾和康复，完成健康指导及心理护理。书写护理记录。含术前备皮。', 'Refers to the care of patients with stable disease, partial self-care, or elderly patients with limited mobility. Every 2-3 hours to inspect the patient, observe the patient\'s condition change, measure the patient\'s body temperature, pulse, breathing and', NULL, '2019-09-20 16:49:32', NULL, NULL, 'other vital signs according to the patient\'s condition, correctly implement the treatment according to the doctor\'s advice, use the medicine, implement the nursing measures and safety measures according to the patient\'s physical condition, and provide the', 'description', ' patient with the patient. Appropriate care and rehabilitation, complete health guidance and psychological care. Write a nursing record. Contains preoperative skin preparation.', NULL);
INSERT INTO `translate` VALUES (23996, 10399, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:49:33', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
