INSERT INTO `translate` VALUES (24001, 10399, '10004', '指病情趋向稳定的重症患者、手术后或者治疗期间需要严格卧床、生活完全不能自理或生活部分自理、病情随时可能发生变化的患者的护理。每小时巡视患者，观察患者病情变化，根据病情每日测量患者体温、脉搏、呼吸等生命体征，根据医嘱正确实施治疗，用药，正确实施口腔护理，压疮预防和护理，管路护理等护理措施，实施安全措施，对患者提供适宜的照顾和康复，健康指导。含术前备皮。', 'Refers to the care of patients with severely ill patients who are in stable condition, after surgery or during treatment, who need to be strictly bedridden, have no life at all, or take care of themselves, and whose condition may change at any time. Pat t', NULL, '2019-09-20 16:49:38', NULL, NULL, 'he patient every hour, observe the patient\'s condition change, measure the patient\'s body temperature, pulse, breathing and other vital signs daily according to the condition, correctly implement the treatment according to the doctor\'s advice, medication,', 'description', ' correct implementation of oral care, pressure sore prevention and care, pipeline care and other nursing measures Implement safety measures to provide appropriate care and rehabilitation for patients and health guidance. Contains preoperative skin prepara', 'tion.');
INSERT INTO `translate` VALUES (24002, 10400, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:49:39', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
