INSERT INTO `translate` VALUES (24007, 10400, '10004', '指病情危重、重症监护、复杂或大手术后，严重外伤和大面积烧伤，使用呼吸机辅助呼吸，实施连续性肾脏替代治疗，及其它生命体征不稳定患者的护理。严密观察患者病情变化和生命体征的改变，监测患者的体温、脉搏、呼吸、血压，根据医嘱正确实施治疗，用药，准确测量24小时出入量，正确实施口腔护理，压疮预防和护理，管路护理等措施，实施安全措施，保持患者的舒适和功能体位，实施床旁交接班，完成健康教育及心理护理，书写特护记录。含术前备皮。', 'Refers to critical illness, intensive care, complicated or major surgery, severe trauma and extensive burns, use of ventilator assisted breathing, continuous renal replacement therapy, and other patients with unstable vital signs. Closely observe changes', NULL, '2019-09-20 16:49:43', NULL, NULL, 'in the patient\'s condition and vital signs, monitor the patient\'s body temperature, pulse, respiration, blood pressure, correct treatment according to the doctor\'s advice, medication, accurate measurement of 24-hour access, correct implementation of oral', 'description', 'care, pressure ulcer prevention and care, pipeline Measures such as nursing, implementation of safety measures, maintaining patient comfort and functional position, implementation of bedside handover, completion of health education and psychological care,', ' writing special care records. Contains preoperative skin preparation.');
