INSERT INTO `translate` VALUES (24014, 10402, '10004', '新生儿护理', 'Newborn care', NULL, '2019-09-20 16:49:48', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24015, 10402, '10004', 'xsehl', 'xsehl', NULL, '2019-09-20 16:49:49', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24016, 10402, '10004', '日', 'day', NULL, '2019-09-20 16:49:50', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24017, 10402, '10004', '评估新生儿适应环境能力，新生儿口腔护理，喂养，称体重，脐部残端护理，臀部护理，换尿布，观察排泄物形态并记录，洗浴，新生儿床位清洁消毒。含新生儿抚触。', 'Evaluate the ability of newborns to adapt to the environment, oral care of newborns, feeding, weighing, umbilical stump care, hip care, changing diapers, observing the form of excreta and recording, bathing, cleaning and disinfection of newborn beds. Cont', NULL, '2019-09-20 16:49:51', NULL, NULL, 'ains newborn touches.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24018, 10403, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:49:52', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24019, 10403, '10004', '10403', '10403', NULL, '2019-09-20 16:49:53', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24020, 10403, '10004', '早产儿护理', 'Premature baby care', NULL, '2019-09-20 16:49:54', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24021, 10403, '10004', 'zcehl', 'zcehl', NULL, '2019-09-20 16:49:55', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24022, 10403, '10004', '日', 'day', NULL, '2019-09-20 16:49:56', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24023, 10403, '10004', '评估早产儿病情，核对医嘱、患儿日龄等信息，准备暖箱，水槽中加适量蒸馏水，设置适宜温度，监护早产儿面色、呼吸、体温、心率变化及各器官功能的成熟情况，定期做暖箱消毒并送细菌培养标本，记录。含新生儿护理及暖箱的应用等。不含实验室检验。', 'Evaluate the condition of premature infants, check the information of doctor\'s orders, age of children, prepare warm boxes, add appropriate amount of distilled water to the water tank, set appropriate temperature, monitor the color, breathing, body temper', NULL, '2019-09-20 16:49:57', NULL, NULL, 'ature, heart rate changes and maturity of various organs of premature infants, and do regular Disinfect the incubator and send the bacteria to the culture specimens for recording. Applications including neonatal care and warm boxes. Does not contain labor', 'description', 'atory tests.', NULL);
INSERT INTO `translate` VALUES (24024, 10404, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:49:57', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24025, 10404, '10004', '10404', '10404', NULL, '2019-09-20 16:49:59', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24026, 10404, '10004', '精神病人护理', 'Mental patient care', NULL, '2019-09-20 16:50:00', NULL, NULL, NULL, 'name', NULL, NULL);
