INSERT INTO `translate` VALUES (24028, 10404, '10004', '日', 'day', NULL, '2019-09-20 16:50:02', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24029, 10404, '10004', '指用于精神病患者的护理。随时巡视患者，观察患者情绪变化，根据患者病情测量患者体温，脉搏，呼吸等生命体征，根据医嘱，正确实施治疗，用药，对患者提供适宜的照顾和康复，健康指导，完成健康教育及心理护理，做好记录。', 'Refers to the care for mental patients. Always inspect the patient, observe the patient\'s emotional changes, measure the patient\'s body temperature, pulse, breathing and other vital signs according to the patient\'s condition, according to the doctor\'s adv', NULL, '2019-09-20 16:50:02', NULL, NULL, 'ice, correctly implement the treatment, medication, provide appropriate care and rehabilitation for the patient, health guidance, complete health education and psychological care ,Take good notes.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24030, 10405, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:03', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24031, 10405, '10004', '10405', '10405', NULL, '2019-09-20 16:50:05', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24032, 10405, '10004', '精神科监护', 'Psychiatric supervision', NULL, '2019-09-20 16:50:06', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24033, 10405, '10004', 'jskjh', 'jskjh', NULL, '2019-09-20 16:50:07', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24034, 10405, '10004', '小时', 'hour', NULL, '2019-09-20 16:50:07', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24035, 10405, '10004', '指对急性、冲动、自杀、伤人、毁物的病人及有外走、妄想、幻觉和木僵的病人实施监护。监护并记录的内容包括：生命体征，意识状态，精神状况，认知，情感，意向行为，对治疗合作度，安全，进食，排泄，一般生活自理，药物不良反应及躯体合并症等。', 'Refers to the monitoring of patients with acute, impulsive, suicidal, wounded, and ruined patients and patients with escaping, delusions, hallucinations, and stupor. The contents monitored and recorded include: vital signs, state of consciousness, mental', NULL, '2019-09-20 16:50:08', NULL, NULL, 'state, cognition, emotion, intentional behavior, cooperation with treatment, safety, eating, excretion, general self-care, adverse drug reactions and physical complications.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24036, 10406, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:09', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24037, 10406, '10004', '10406', '10406', NULL, '2019-09-20 16:50:10', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24038, 10406, '10004', '一般传染病护理', 'General infectious disease care', NULL, '2019-09-20 16:50:11', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24039, 10406, '10004', 'ybcrbhl', 'ybcrbhl', NULL, '2019-09-20 16:50:12', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24040, 10406, '10004', '日', 'day', NULL, '2019-09-20 16:50:12', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24041, 10406, '10004', '指经消化道、呼吸道、接触等传播的传染病的护理。评估病情、既往史及合作情况等，洗手，戴口罩、帽子，穿隔离衣，戴手套，做好解释取得配合，患者用物擦拭消毒，患者分泌物及污物严格消毒处理，每日房间空气消毒，定期做隔离环境的细菌学采样检测，协助患者外出检查时做好防护。', 'Refers to the care of infectious diseases transmitted through the digestive tract, respiratory tract, contact, etc. Evaluate the condition, past history and cooperation, wash hands, wear masks, hats, gowns, gloves, make explanations, cooperate with patien', NULL, '2019-09-20 16:50:13', NULL, NULL, 'ts, wipe disinfection, patient secretions and dirt are strictly disinfected, daily room air Disinfection, regular bacteriological sampling test to isolate the environment, to help patients protect when going out.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24042, 10407, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:14', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24043, 10407, '10004', '10407', '10407', NULL, '2019-09-20 16:50:15', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24044, 10407, '10004', '严密隔离护理', 'Strict isolation care', NULL, '2019-09-20 16:50:15', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24045, 10407, '10004', 'ymglhl', 'ymglhl', NULL, '2019-09-20 16:50:16', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24046, 10407, '10004', '日', 'day', NULL, '2019-09-20 16:50:17', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24047, 10407, '10004', '指烈性传染病的护理。评估病情及合作情况等，洗手，戴口罩、帽子，穿消毒隔离衣及隔离鞋，戴手套，戴防护眼镜，做好解释取得配合，禁止探视，设置警示牌，患者分泌物，呕吐物及排泄物严格消毒处理，污染敷料装入袋中，做好标记集中焚烧，每日房间及用物消毒，定期做隔离环境的细菌学采样检测。', 'Refers to the care of severe infectious diseases. Evaluate the condition and cooperation, wash hands, wear masks, hats, wear disinfectant gowns and isolation shoes, wear gloves, wear protective glasses, make explanations, cooperate, prohibit visits, set w', NULL, '2019-09-20 16:50:18', NULL, NULL, 'arning signs, patient secretions, vomit and excretion The materials are strictly disinfected, the contaminated dressings are put into the bag, the mark is incinerated intensively, the room and the materials are disinfected daily, and the bacteriological s', 'description', 'ampling test for the isolated environment is regularly performed.', NULL);
INSERT INTO `translate` VALUES (24048, 10408, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:19', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24049, 10408, '10004', '10408', '10408', NULL, '2019-09-20 16:50:20', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24050, 10408, '10004', '保护性隔离护理', 'Protective isolation care', NULL, '2019-09-20 16:50:21', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24051, 10408, '10004', 'bhxglhl', 'Bhaggalhal', NULL, '2019-09-20 16:50:21', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24052, 10408, '10004', '日', 'day', NULL, '2019-09-20 16:50:22', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24053, 10408, '10004', '指用于抵抗力低或极易感染患者的护理。了解患者病情及血象，评估病情及合作情况等，洗手，戴口罩、帽子，穿隔离衣，戴手套，做好解释取得配合，注意保护患者，患者用物经消毒后带入房间，餐具每日消毒，便后清洁肛门，每日房间紫外线空气消毒，定期做隔离环境的细菌学采样检测，限制探视。', 'Refers to care for patients with low or very susceptible infections. Understand the patient\'s condition and blood, assess the condition and cooperation, wash hands, wear masks, hats, gowns, gloves, explain and cooperate, pay attention to protect patients,', NULL, '2019-09-20 16:50:23', NULL, NULL, 'patient materials are brought into the room after disinfection, tableware daily Disinfect, clean the anus afterwards, disinfect the UV room in the daily room, and regularly perform bacteriological sampling tests to isolate the environment and limit acces', 'description', 's.', NULL);
INSERT INTO `translate` VALUES (24054, 10409, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:24', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24055, 10409, '10004', '10409', '10409', NULL, '2019-09-20 16:50:25', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24056, 10409, '10004', '新生儿治疗浴', 'Neonatal treatment bath', NULL, '2019-09-20 16:50:26', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24057, 10409, '10004', 'xsezly', 'xsezly', NULL, '2019-09-20 16:50:27', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24058, 10409, '10004', '次', 'Times', NULL, '2019-09-20 16:50:28', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24059, 10409, '10004', '评估新生儿情况、日龄，调节操作台温度及环境湿度，核对医嘱及患儿信息，检查患儿皮肤情况，用无菌注射器配制治疗浴液，按新生儿沐浴顺序进行治疗浴，治疗浴毕擦干皮肤，再次检查皮肤情况及效果，操作毕为患儿穿衣，处理用物，记录。', 'Evaluate the condition of the newborn, age, adjust the temperature of the operating table and the humidity of the environment, check the information of the doctor and the child, check the skin condition of the child, prepare the therapeutic bath with a st', NULL, '2019-09-20 16:50:28', NULL, NULL, 'erile syringe, and perform the therapeutic bath according to the order of the newborn bath. Dry the skin, check the skin condition and effect again, and wear the clothes, handle the contents, and record.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24060, 10410, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:29', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
