INSERT INTO `translate` VALUES (24065, 10410, '10004', '开启监护仪，连接病人，调节心率和呼吸报警上下限及报警音量，连接血压袖带，调节血压报警限和测量间隔时间，启动测量开关，连接经皮血氧探头，调节血氧报警限。', 'Turn on the monitor, connect the patient, adjust the upper and lower limits of heart rate and respiratory alarm and alarm volume, connect the blood pressure cuff, adjust the blood pressure alarm limit and measurement interval time, start the measurement s', NULL, '2019-09-20 16:50:33', NULL, NULL, 'witch, connect the percutaneous blood oxygen probe, and adjust the blood oxygen alarm limit.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24066, 10411, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:34', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
