INSERT INTO `translate` VALUES (24071, 10411, '10004', '评估患者病情等，核对患者信息并做好解释取得配合，准备用物，使用无菌注射器吸取抗凝剂或生理盐水定时冲管保持管道通畅，取适当体位，调整零点，测压，观察穿刺点，更换无菌敷料保持干燥清洁，固定导管，做好健康教育和心理护理。', 'Evaluate the patient\'s condition, check the patient\'s information and explain it. Get ready to use the product. Use a sterile syringe to absorb the anticoagulant or saline to keep the pipe open. Take the appropriate position, adjust the zero point, measur', NULL, '2019-09-20 16:50:38', NULL, NULL, 'e the pressure, and observe the puncture point. Replace the sterile dressings to keep them dry and clean, fix the catheters, and do health education and psychological care.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24072, 10412, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:50:39', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
