INSERT INTO `translate` VALUES (24077, 10412, '10004', '指中心静脉置管护理、PICC置管护理。核对患者信息，评估患者病情、合作程度及置管周围皮肤情况等，解释其目的取得配合，观察管路通畅情况，测量外管路长度等，必要时测量臂围，严格无菌操作进行消毒，防止留置管阻塞和管路感染，使用无菌注射器或一次性封管针脉冲式正压封管，严禁提前配置冲管液当日用于多人封管，更换无菌敷料并固定、再次测量管路长度、记录、做好健康教育和心理护理。', 'Refers to central venous catheter care, PICC catheter care. Check the patient information, assess the patient\'s condition, cooperation level and the surrounding skin condition, explain the purpose of the cooperation, observe the patency of the pipeline, m', NULL, '2019-09-20 16:50:44', NULL, NULL, 'easure the length of the outer pipeline, etc., if necessary, measure the arm circumference, strictly aseptic operation for disinfection, To prevent indwelling tube obstruction and tube infection, use sterile syringe or disposable sealing needle pulse posi', 'description', 'tive pressure sealing tube. It is strictly forbidden to configure the flushing liquid in advance for multi-person sealing, replace sterile dressing and fix, measure again Road length, records, health education and psychological care.', NULL);
