INSERT INTO `translate` VALUES (24083, 10413, '10004', '评估患者病情、合作程度及口腔状况，核对患者信息，做好解释取得配合，取适当体位，打开消毒口腔护理包，清点棉球，漱口，检查口腔，观察有无口腔黏膜疾患，必要时通知医生，按需要选择漱口液，按顺序清洁口腔，再次漱口并检查口腔，再次清点棉球，协助患者恢复舒适体位，处理用物，观察患者生命体征并记录，做好健康教育及心理护理。', 'Evaluate the patient\'s condition, cooperation level and oral condition, check the patient information, explain and cooperate, take appropriate position, open the disinfection oral care package, check the cotton ball, rinse the mouth, check the oral cavity', NULL, '2019-09-20 16:50:48', NULL, NULL, ', observe the presence or absence of oral mucosal disease, notify if necessary The doctor chooses the mouthwash as needed, cleans the mouth in order, rinses the mouth again and checks the mouth, checks the cotton ball again, assists the patient to restore', 'description', ' a comfortable position, treats the object, observes the patient\'s vital signs and records, and does a good health education and psychological care. .', NULL);
