INSERT INTO `translate` VALUES (24089, 10414, '10004', '评估患者病情、意识状态、气管切开周围皮肤情况等，核对患者信息，做好解释取得配合，监测并保持气囊的压力，必要时人工气道内药物滴入（打开人工气道，吸气相时滴入药物，观察用药后效果并记录），随时清理呼吸道分泌物，局部消毒，更换敷料，保持气管切开处清洁干燥，固定，观察伤口有无感染并记录，做好健康教育及心理护理。', 'Evaluate the patient\'s condition, state of consciousness, skin condition around the tracheotomy, check the patient information, explain and cooperate, monitor and maintain the pressure of the balloon, and if necessary, inject the drug into the artificial', NULL, '2019-09-20 16:50:54', NULL, NULL, 'airway (open the artificial airway, inhale the gas phase) Instill the drug, observe the effect after the drug and record), clean up the respiratory secretions at any time, local disinfection, change the dressing, keep the trache incision clean and dry, fi', 'description', 'x, observe the wound for infection and record, do health education and psychological care.', NULL);
