INSERT INTO `translate` VALUES (24095, 10415, '10004', '评估患者病情、意识状态、气管切开周围皮肤情况，核对患者信息，做好解释取得配合，准备用物，取出并更换套管，套管消毒，评价并记录，做好健康教育及心理护理。', 'Evaluate the patient\'s condition, state of consciousness, skin around the tracheotomy, check patient information, explain and cooperate, prepare materials, take out and replace casing, sterilize, evaluate and record, and do health education and psychologi', NULL, '2019-09-20 16:50:59', NULL, NULL, 'cal care.', 'description', NULL, NULL);
