INSERT INTO `translate` VALUES (24101, 10416, '10004', '评估患者病情、意识状态、气管插管深度及导管型号等，核对患者信息，做好解释取得配合，监测并保持气囊的压力，必要时人工气道内药物滴入（打开人工气道，吸气相时滴入药物，观察用药后效果并记录），随时清理呼吸道分泌物，必要时使用呼吸过滤器保持气道温湿度，更换固定胶布，无菌牙垫及无菌敷料，保持固定带清洁干燥，观察气管外置长度并记录，做好健康教育及心理护理。', 'Evaluate the patient\'s condition, state of consciousness, tracheal intubation depth and catheter type, check the patient information, explain and cooperate, monitor and maintain the pressure of the balloon, and if necessary, inject the drug into the artif', NULL, '2019-09-20 16:51:05', NULL, NULL, 'icial airway (open the artificial airway, inhale the gas When injecting the drug, observe the effect after the drug is recorded and record), clean the respiratory secretions at any time, use the respiratory filter to maintain the temperature and humidity', 'description', 'of the airway if necessary, replace the fixed adhesive tape, sterile dental pad and sterile dressing, keep the fixed band clean and dry, Observe the external length of the trachea and record it, and do a good job in health education and psychological care', '.');
INSERT INTO `translate` VALUES (24102, 10417, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:51:06', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
