INSERT INTO `translate` VALUES (24107, 10417, '10004', '评估患者病情、意识状态、呼吸道分泌物情况等，核对患者信息，做好解释取得配合，连接吸引器调整负压，取适当体位，戴无菌手套，检查连接好的无菌吸痰管通畅，将吸痰管插入气道，缓慢旋转提取进行抽吸，调整氧气流量，观察患者生命体征及痰液性质，协助患者采取舒适体位，评价吸痰效果，记录，完成健康教育及心理护理。', 'Evaluate the patient\'s condition, state of consciousness, respiratory secretions, etc., check the patient information, explain and cooperate, connect the suction device to adjust the negative pressure, take the appropriate position, wear sterile gloves, a', NULL, '2019-09-20 16:51:11', NULL, NULL, 'nd check the connected sterile suction tube. Insert the suction tube into the airway, slowly rotate the extraction for aspiration, adjust the oxygen flow, observe the patient\'s vital signs and sputum properties, assist the patient to take a comfortable po', 'description', 'sition, evaluate the sucking effect, record, complete the health education and psychological care.', NULL);
INSERT INTO `translate` VALUES (24108, 10418, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:51:11', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
