INSERT INTO `translate` VALUES (24111, 10418, '10004', 'hxjxthl', 'hxjxthl', NULL, '2019-09-20 16:51:14', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24112, 10418, '10004', '次', 'Times', NULL, '2019-09-20 16:51:15', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24113, 10418, '10004', '评估患者病情、意识状态及呼吸道分泌物情况等，核对患者信息，做好解释取得配合，连接吸引器调整负压，取适当体位，遵医嘱滴入化痰药，观察患者生命体征，呼吸机消警，给纯氧2分钟，戴无菌手套，检查连接好的无菌吸痰管通畅，打开气道，按无菌操作原则将吸痰管插入气道，缓慢旋转提取进行抽吸（时间小于15秒），再次给纯氧2分钟，观察患者生命体征及痰液性质，评价吸痰效果，记录，完成健康教育及心理护理。', 'Evaluate the patient\'s condition, state of consciousness and respiratory secretions, check the patient information, explain and cooperate, connect the suction device to adjust the negative pressure, take the appropriate position, follow the doctor\'s advic', NULL, '2019-09-20 16:51:15', NULL, NULL, 'e, drip into the phlegm, observe the patient\'s vital signs, ventilator Police, give pure oxygen for 2 minutes, wear sterile gloves, check the connected sterile suction tube, open the airway, insert the suction tube into the airway according to the princip', 'description', 'le of aseptic operation, slowly rotate the extraction for suction (time is less than 15 seconds), give pure oxygen again for 2 minutes, observe the patient\'s vital signs and sputum properties, evaluate the sucking effect, record, complete health education', ' and psychological care.');
INSERT INTO `translate` VALUES (24114, 10419, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:51:16', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
INSERT INTO `translate` VALUES (24115, 10419, '10004', '10419', '10419', NULL, '2019-09-20 16:51:17', NULL, NULL, NULL, 'id', NULL, NULL);
INSERT INTO `translate` VALUES (24116, 10419, '10004', '引流管护理', 'Drainage tube care', NULL, '2019-09-20 16:51:18', NULL, NULL, NULL, 'name', NULL, NULL);
INSERT INTO `translate` VALUES (24117, 10419, '10004', 'ylghl', 'ylghl', NULL, '2019-09-20 16:51:19', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
