INSERT INTO `translate` VALUES (24119, 10419, '10004', '指各种引流管护理，包括引流管冲洗。评估患者病情及引流情况等，核对患者信息，解释其目的取得配合，准备用物，取适当体位，戴手套，合理暴露伤口，观察引流液的量、色及性质，严格无菌操作原则用蘸有消毒液的棉签消毒，更换无菌敷料，倾倒引流液，观察患者生命体征，预防并发症，处理用物，记录，做好健康教育及心理护理。含胃、小肠、胆囊、膀胱、肾等造瘘管护理。', 'Refers to a variety of drainage tube care, including drainage tube irrigation. Evaluate the patient\'s condition and drainage, check the patient\'s information, explain the purpose of the cooperation, prepare the use of the object, take the appropriate posi', NULL, '2019-09-20 16:51:21', NULL, NULL, 'tion, wear gloves, reasonably expose the wound, observe the amount, color and nature of the drainage fluid, and strictly use the principle of aseptic operation. Disinfect the cotton swab with disinfectant, replace the sterile dressing, pour the drainage f', 'description', 'luid, observe the patient\'s vital signs, prevent complications, treat the use of materials, record, and do health education and psychological care. Contains stomach, small intestine, gallbladder, bladder, kidney and other sputum tube care.', NULL);
INSERT INTO `translate` VALUES (24120, 10420, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:51:21', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
