INSERT INTO `translate` VALUES (24124, 10420, '10004', '日', 'day', NULL, '2019-09-20 16:51:25', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24125, 10420, '10004', '指回肠、结肠造口，尿路造口的护理。评估患者病情、合作程度、造口周围皮肤情况等，核对患者信息，做好解释取得配合，造口周围皮肤、排泄物及并发症的观察和处理，根据造口缺血坏死、皮肤黏膜分离、造口回缩、造口狭窄、造口脱垂、造口旁疝、造口周围皮肤问题、出血等选择适宜的敷料、药物和造口用品，并清洁皮肤及造口，测量造口大小，剪裁无菌底盘，粘贴底盘，固定无菌造口袋，记录，做好健康教育和心理指导。', 'Refers to the care of the ileum, colostomy, and urinary ostomy. Evaluate the patient\'s condition, cooperation level, skin condition around the stoma, check the patient information, explain and cooperate, observe and treat the skin around the stoma, excret', NULL, '2019-09-20 16:51:26', NULL, NULL, 'ion and complications, according to ostomy ischemic necrosis, skin mucosal separation, Choose a suitable dressing, medicine and ostomy, and clean the skin and stoma, and measure the size of the stoma, such as stoma retraction, narrow stoma, ostomy prolaps', 'description', 'e, ostomy, skin problems around the stoma, bleeding, etc. Cut the sterile chassis, paste the chassis, fix the sterile ostomy pouch, record, and do health education and psychological guidance.', NULL);
