INSERT INTO `translate` VALUES (24151, 10425, '10004', '指皮内注射治疗或药物皮内注射试验。核对医嘱及患者信息，检查注射器及药物，用无菌注射器配制药物，取舒适体位，选择注射部位，皮肤消毒（直径大于5厘米），再次核对患者信息，将药物注入皮内组织，拔针后按压注射部位并第三次核对患者信息，处理用物，用药后观察用药反应，做好健康教育及心理护理，必要时记录。', 'Refers to intradermal injection therapy or drug intradermal injection test. Check the doctor\'s advice and patient information, check the syringe and medicine, prepare the medicine with a sterile syringe, take a comfortable position, select the injection s', NULL, '2019-09-20 16:51:49', NULL, NULL, 'ite, disinfect the skin (diameter greater than 5 cm), check the patient information again, inject the drug into the intradermal tissue, after the needle is pulled Press the injection site and check the patient information for the third time, treat the med', 'description', 'ication, observe the medication response after medication, do a good health education and psychological care, and record if necessary.', NULL);
