INSERT INTO `translate` VALUES (24157, 10426, '10004', '核对医嘱及患者信息，检查注射器及药物，用无菌注射器配制药物，取适当体位，选择并确定注射部位，皮肤消毒（直径大于5厘米），再次核对患者信息，将药物注入皮下组织，拔针后按压注射部位并第3次核对患者信息，协助患者恢复舒适体位，处理用物，用药后观察用药反应，做好健康教育及心理护理，必要时记录。', 'Check the doctor\'s advice and patient information, check the syringe and the drug, prepare the drug with a sterile syringe, take the appropriate position, select and determine the injection site, disinfect the skin (diameter greater than 5 cm), check the', NULL, '2019-09-20 16:51:54', NULL, NULL, 'patient information again, inject the drug into the subcutaneous tissue, and pull the needle After pressing the injection site and checking the patient information for the third time, assisting the patient to restore the comfortable position, handling the', 'description', ' medication, observing the medication response after medication, doing health education and psychological care, and recording if necessary.', NULL);
