INSERT INTO `translate` VALUES (24163, 10427, '10004', '核对医嘱及患者信息，检查注射器及药物，使用无菌注射器配制药物，取适当体位，选择并确定注射部位，皮肤消毒（直径大于5厘米），再次核对患者信息，将药物注入肌肉组织，拔针后按压注射部位并核对患者信息，协助患者恢复舒适体位，处理用物，用药后观察用药反应，做好健康教育及心理护理，必要时记录。', 'Check the doctor\'s advice and patient information, check the syringe and drugs, use a sterile syringe to prepare the drug, take the appropriate position, select and determine the injection site, disinfect the skin (diameter greater than 5 cm), check the p', NULL, '2019-09-20 16:52:00', NULL, NULL, 'atient information again, inject the drug into the muscle tissue, and pull the needle After pressing the injection site and checking the patient information, assisting the patient to restore a comfortable position, handling the medication, observing the m', 'description', 'edication response after medication, doing a good health education and psychological care, and recording if necessary.', NULL);
