INSERT INTO `translate` VALUES (24169, 10428, '10004', '核对医嘱及患者信息，用无菌注射器配制药物，取适当体位，选择注射部位，皮肤消毒（直径大于5厘米），再次核对患者信息，将药物注入静脉（Tennon氏囊下），拔针后按压注射部位并第3次核对患者信息，协助患者恢复舒适体位，处理用物，用药后观察用药反应，做好健康教育及心理护理，必要时记录。', 'Check the doctor\'s advice and patient information, prepare the drug with a sterile syringe, take the appropriate position, select the injection site, disinfect the skin (diameter greater than 5 cm), check the patient information again, inject the drug int', NULL, '2019-09-20 16:52:05', NULL, NULL, 'o the vein (under the Tennon\'s capsule), press the needle after the needle is removed. Inject the site and check the patient information for the third time, assist the patient to restore the comfortable position, handle the medication, observe the medicat', 'description', 'ion response after medication, do a good health education and psychological care, and record if necessary.', NULL);
