INSERT INTO `translate` VALUES (24179, 10430, '10004', '确定采血动脉穿刺点后，消毒，以连接无菌注射器的无菌针头垂直进针穿刺动脉，见鲜红色动脉血进入无菌注射器并达到检测需要的血量后，退出穿刺针，以无菌棉签压迫穿刺点止血，以胶塞封闭注射器针头以隔绝空气，将血样以冰袋或冰壶保存送检。', 'After determining the puncture point of the blood collection artery, disinfection, connect the sterile needle of the sterile syringe to the needle and puncture the artery vertically. See the bright red arterial blood and enter the sterile syringe and reac', NULL, '2019-09-20 16:52:15', NULL, NULL, 'h the blood volume required for the test. Then withdraw the puncture needle to the sterile cotton swab. Press the puncture point to stop bleeding, close the syringe needle with a rubber stopper to isolate the air, and save the blood sample in ice pack or', 'description', 'curling.', NULL);
