INSERT INTO `translate` VALUES (24185, 10431, '10004', '核对医嘱及患者信息，评估患者，取适当体位，选择穿刺部位，皮肤消毒（直径大于5厘米），用无菌采血针静脉穿刺并固定，将适量血缓慢流入采血管，拔针后按压穿刺部位，将血缓慢注入采血管，再次核对患者信息，协助患者采取舒适体位，处理用物，标本送检，做好健康教育及心理护理。', 'Check the doctor\'s advice and patient information, evaluate the patient, take the appropriate position, select the puncture site, disinfect the skin (diameter greater than 5 cm), puncture and fix with a sterile blood collection needle, slowly transfer the', NULL, '2019-09-20 16:52:20', NULL, NULL, 'appropriate amount of blood into the blood collection tube, and press the puncture site after the needle is pulled. Slowly inject blood into the blood collection tube, check the patient information again, assist the patient to take a comfortable position', 'description', ', handle the use of the object, send the specimen for inspection, and do a good health education and psychological care.', NULL);
