INSERT INTO `translate` VALUES (24195, 10433, '10004', '评估患者及穿刺部位等，核对医嘱及患者信息，用无菌注射器配制药物，连接无菌输液器或避光输液器，取适当体位使用无菌压脉带，选择穿刺部位，皮肤消毒（直径大于5厘米），排气，再次核对患者信息，头皮针穿刺，用无菌敷料进行固定，调节滴速并第3次核对患者信息，协助患者恢复舒适体位，处理用物，观察输液反应。必要时留置针置管护理、健康教育及心理护理，记录。如需连续输注几组液体，要核对患者信息，注意药物之间的配伍禁忌，密切观察输液反应，协助患者舒适体位。含输液过程中各种药物注入。', 'Evaluate the patient and the puncture site, check the doctor\'s advice and patient information, use a sterile syringe to prepare the drug, connect the sterile infusion set or the dark infusion set, take the appropriate position and use the sterile cuff, se', NULL, '2019-09-20 16:52:30', NULL, NULL, 'lect the puncture site, and disinfect the skin (larger diameter than 5 cm), exhaust, check the patient information again, scalp needle puncture, fix with sterile dressing, adjust the drip rate and check the patient information for the third time, assist t', 'description', 'he patient to restore the comfortable position, treat the object, and observe the infusion reaction. If necessary, indwelling needle care, health education and psychological care, record. If you need to continuously inject several groups of fluids, check ', 'the patient information, pay attention to the incompatibility between the drugs, closely observe the infusion reaction, and assist the patient in a comfortable position. Infusion of various drugs during infusion.');
