INSERT INTO `translate` VALUES (24201, 10434, '10004', '指使用输液泵或微量泵辅助静脉输液、注射。评估患者及穿刺静脉情况等，核对医嘱及患者信息，用无菌注射器配制药物，检查输液泵，用输液管连接输液泵装置，排尽空气，将无菌泵管置于输液泵上，开机并调节输液泵，取适当体位，选择注射部位，皮肤消毒（直径大于5厘米），再次核对患者信息，用无菌头皮针穿刺，无菌敷料固定，设定速度并第3次核对患者信息，协助患者恢复舒适体位，处理用物，用药后观察，做好健康教育及心理护理，必要时记录。含输液过程中各种药物注入。', 'Refers to the use of infusion pumps or micro-pumps to assist intravenous infusion and injection. Evaluate the patient and puncture veins, check the doctor\'s advice and patient information, prepare the drug with a sterile syringe, check the infusion pump,', NULL, '2019-09-20 16:52:36', NULL, NULL, 'connect the infusion pump device with the infusion tube, drain the air, place the sterile pump tube on the infusion pump, turn it on and Adjust the infusion pump, take the appropriate position, select the injection site, disinfect the skin (diameter great', 'description', 'er than 5 cm), check the patient information again, use a sterile scalp needle puncture, fix the sterile dressing, set the speed and check the patient information for the third time. The patient recovers the comfortable position, handles the use of the ob', 'ject, observes after the medication, and performs health education and psychological care, and records if necessary. Infusion of various drugs during infusion.');
