INSERT INTO `translate` VALUES (24213, 10436, '10004', '评估患者及穿刺部位等，血制品检查，核对医嘱及患者信息，严格查对制度，解释其目的取得配合，取适当体位，连接无菌输血器，选择穿刺部位，皮肤消毒（直径大于5厘米），排气，再次核对患者信息，用头皮针穿刺并固定，遵医嘱输液前输注生理盐水，用无菌注射器给予抗过敏药物，输入血制品，调节滴速，生理盐水冲管，并第3次核对患者信息，观察有无输血反应及血压变化，协助患者恢复舒适体位，输血毕血袋低温保存24小时，记录，做好健康教育及心理护理。', 'Evaluate patients and puncture sites, blood product examinations, check medical orders and patient information, strictly check the system, explain the purpose of matching, take appropriate position, connect sterile blood transfusion device, select punctur', NULL, '2019-09-20 16:52:47', NULL, NULL, 'e site, skin disinfection (diameter greater than 5 cm) Exhaust, check the patient information again, puncture and fix with scalp needle, inject normal saline before infusion, give anti-allergic drugs with sterile syringe, input blood products, adjust drip', 'description', ' rate, flush with saline, and 3rd Check the patient information, observe whether there is blood transfusion reaction and blood pressure change, help the patient to restore a comfortable position, blood transfusion blood bag for 24 hours, record, do health', ' education and psychological care.');
