INSERT INTO `translate` VALUES (24237, 10441, '10004', 'kzlhlywhcwyyyjzpz', 'kzlhlywhcwyyyjzpz', NULL, '2019-09-20 16:53:11', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
