INSERT INTO `translate` VALUES (24239, 10441, '10004', '指在集中配液中心进行的对抗肿瘤化疗药物或肠外营养液的配置。遵医嘱，核对治疗方案，准备药物，穿无菌防护服，戴无菌手套及无菌防护眼镜，打开层流柜，严格按无菌操作原则将药物加入相应的无菌液体中，再次核对患者信息。必要时将药物放入特殊装置，处理用物。', 'Refers to the configuration of anti-tumor chemotherapy drugs or parenteral nutrition liquids in a centralized dosing center. Follow the doctor\'s advice, check the treatment plan, prepare the medicine, wear sterile protective clothing, wear sterile gloves', NULL, '2019-09-20 16:53:13', NULL, NULL, 'and sterile protective glasses, open the laminar flow cabinet, and strictly add the medicine to the corresponding sterile liquid according to the principle of aseptic operation, and check the patient again. information. If necessary, put the medicine into', 'description', ' a special device and handle the contents.', NULL);
