INSERT INTO `translate` VALUES (24245, 10442, '10004', '术前准备（给镇静剂、备皮），入换血室，在辐射抢救台上铺巾，断脐，插脐静脉导管，反复抽取和推注血液，术中监测中心静脉压4次，术前后留取血样检查，术毕拔管，脐部压迫止血。不含监护。', 'Preoperative preparation (giving sedatives, preparation of skin), into the blood transfusion room, laying a towel on the radiation rescue station, breaking the umbilicus, inserting the umbilical vein catheter, repeatedly taking and pushing the blood, moni', NULL, '2019-09-20 16:53:18', NULL, NULL, 'toring the central venous pressure 4 times during the operation, before and after surgery Blood samples were taken for examination, and the umbilical cord was pressed to stop bleeding. No supervision.', 'description', NULL, NULL);
