INSERT INTO `translate` VALUES (24255, 10444, '10004', '评估患者病情、合作程度及穿刺血管情况等，核对医嘱及患者信息，取适当体位，检查导管，测量导管插入长度，选择穿刺部位，皮肤消毒（直径10厘米），无菌注射器预冲导管，静脉穿刺，送导管至预计长度，撤导丝，抽回血并冲管，修剪长度安装连接器，连接肝素帽并正压封管，无菌敷料固定，处理用物，观察患者反应并记录，做好健康教育及心理护理。不含超声引导、X线检查。', 'Evaluate the patient\'s condition, cooperation level and puncture vascular condition, check the doctor\'s advice and patient information, take the appropriate position, check the catheter, measure the catheter insertion length, select the puncture site, ski', NULL, '2019-09-20 16:53:26', NULL, NULL, 'n disinfection (diameter 10 cm), sterile syringe pre-crush catheter, vein Puncture, send catheter to the expected length, withdraw the guide wire, withdraw blood and flush the tube, trim the length to install the connector, connect the heparin cap and pos', 'description', 'itive pressure sealing tube, fix the sterile dressing, treat the object, observe the patient\'s reaction and record, do well Health education and psychological care. Does not include ultrasound guidance, X-ray examination.', NULL);
