INSERT INTO `translate` VALUES (24261, 10445, '10004', '选择合适的脐导管并测量所需插入长度，消毒术野皮肤，铺巾，切断脐带残端，暴露脐血管（动脉或静脉），插入导管至所需刻度，抽回血并推注输液，缝合固定，接输液器。不含监护。', 'Select the appropriate umbilical catheter and measure the required insertion length, disinfect the skin of the field, spread the towel, cut the umbilical cord stump, expose the umbilical blood vessels (arteries or veins), insert the catheter to the requir', NULL, '2019-09-20 16:53:31', NULL, NULL, 'ed scale, withdraw blood and push the infusion, suture fixation , connect the infusion set. No supervision.', 'description', NULL, NULL);
