INSERT INTO `translate` VALUES (24271, 10447, '10004', '指符合下列任一情况者：表浅切伤，裂伤，刺伤，伤口长度1-5厘米（含5厘米）等。消毒铺巾，清除血肿，冲洗，切口及表浅软组织缝合。', 'Refers to any of the following conditions: superficial cut, laceration, stab wound, wound length 1-5 cm (including 5 cm). Disinfect the drape, remove the hematoma, wash, incision and superficial soft tissue suture.', NULL, '2019-09-20 16:53:40', NULL, NULL, NULL, 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24272, 10448, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:53:41', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
