INSERT INTO `translate` VALUES (24277, 10448, '10004', '指符合下列任一情况者：轻微污染伤口，软组织轻度损伤，皮肤轻度损伤或缺损，异物存在，伤口长度5-10厘米等。消毒铺巾，伤口探查，扩大切口，清除坏死组织及异物，冲洗，缝合伤口。必要时置引流管引出并固定。', 'Refers to any of the following conditions: slightly contaminated wounds, mild soft tissue damage, mild skin damage or defects, foreign bodies, wound length 5-10 cm. Disinfect the drape, explore the wound, enlarge the incision, remove necrotic tissue and f', NULL, '2019-09-20 16:53:45', NULL, NULL, 'oreign bodies, rinse, and suture the wound. If necessary, place the drainage tube out and fix it.', 'description', NULL, NULL);
INSERT INTO `translate` VALUES (24278, 10449, '10004', '-8632316295057003850', '-8632316295057003850', NULL, '2019-09-20 16:53:46', NULL, NULL, NULL, 'serialVersionUID', NULL, NULL);
