INSERT INTO `translate` VALUES (24281, 10449, '10004', 'qchfhs-d', 'qchfhs-d', NULL, '2019-09-20 16:53:49', NULL, NULL, NULL, 'pinyinCode', NULL, NULL);
INSERT INTO `translate` VALUES (24282, 10449, '10004', '次', 'Times', NULL, '2019-09-20 16:53:50', NULL, NULL, NULL, 'unit', NULL, NULL);
INSERT INTO `translate` VALUES (24283, 10449, '10004', '指符合下列任一情况者：严重污染伤口，软组织严重损伤，皮肤严重损伤或缺损，特殊感染伤口，二期清创，多发异物伤口，血管、神经、肌肉、骨骼、关节严重损伤伤口，化学武器创口，伤口长度大于10厘米等。消毒铺巾，伤口探查，扩大切口，切开深筋膜，清除坏死组织及异物，冲洗，新鲜伤口逐层缝合。必要时置引流管引出并固定，包扎伤口。不含神经、血管、肌腱吻合。', 'Refers to any of the following conditions: severely contaminated wounds, severe soft tissue damage, severe skin damage or defects, special infection wounds, second stage debridement, multiple foreign body wounds, severe damage to blood vessels, nerves, mu', NULL, '2019-09-20 16:53:51', NULL, NULL, 'scles, bones, joints, chemical weapons Wound, the length of the wound is greater than 10 cm. Disinfect the drape, explore the wound, enlarge the incision, cut the deep fascia, remove the necrotic tissue and foreign bodies, rinse, and suture the fresh woun', 'description', 'd layer by layer. If necessary, the drainage tube is taken out and fixed, and the wound is wrapped. Does not contain nerves, blood vessels, tendon anastomosis.', NULL);
