INSERT INTO `translate` VALUES (24293, 10451, '10004', '指符合下列任一情况者：清洁伤口，缝合3针以内伤口拆线（含皮内连续缝合拆线）等。消毒铺巾，更换敷料、引流物，包扎固定。', 'Refers to any of the following conditions: cleaning the wound, suturing the wound within 3 needles (including suture removal within the skin). Disinfect the towel, replace the dressing, drainage, and fix it.', NULL, '2019-09-20 16:54:01', NULL, NULL, NULL, 'description', NULL, NULL);
